import React from 'react';
import {Switch, Route} from 'react-router-dom';

import Landing from './landingpage';
import AboutMe from "./aboutme";
import Projects from './projects'


const Main = () => (
    <Switch>
        <Route exact path="/" component={Landing} />
    </Switch>
);

export default Main;
